Commentaire visaBTP Consultant:
Georgio RAHMOUCH :
Pour la partie en rez-de-chaussée exposé aux chocs : 

Afin de respecter les exigences de la norme NF P 08-302 pour l'exposition Q4 relative à la résistance aux chocs des pierres, les plaques de pierre doivent satisfaire aux conditions suivantes :

surface < 0,60 m2 ;

distance maximale entre points de fixation dans les chants : 0,80 m ;

épaisseur e de la pierre :

e ? 60 mm si 300 N ? Remoy ? 1 000 N ;

e ? 50 mm si 1 000 N < Remoy ? 1 500 N ;

e ? 40 mm si 1 500 N < Remoy.

(Amendement A1) «  Remoy étant la résistance moyenne aux attaches pour une pierre de 3 cm d'épaisseur selon la norme NF EN 13364.  »

L'ergot doit être excentré de façon que la distance entre le nu de la face vue et le bord du trou soit supérieure à 20 mm.

